def get_url(page)
  urls = []
  page = Nokogiri::HTML(open(page))
  page.xpath('/html/body/div/div[3]/div/div/section/div/article/div[3]/div/div[3]/div/ul/li/a/@href').each do |href|
    urls << 'http://www2.assemblee-nationale.fr'.concat(href.text)
  end
  return urls
end

#this line scrapes all deputy personal pages off the web <--- uncomment here to get 577 deputies
#urls = get_url('http://www2.assemblee-nationale.fr/deputes/liste/alphabetique')

def get_deputy_info(deputy_page)
  array = []
  deputy_page.each { |url|
    my_hash = {"name"=> "","surname"=>"","email"=>""}
    page = Nokogiri::HTML(open(url))
    page.xpath('/html/body/div/div[3]/div/div/div/section[1]/div/article/div[3]/div/dl/dd[4]/ul/li[2]/a').each do |email|
      my_hash["email"] = email.text
    end
    page.xpath('/html/body/div/div[3]/div/div/div/section[1]/div/article/div[2]/h1').each do |name|
      my_hash["name"] = name.text.split()[1]
      my_hash["surname"] = name.text.split()[2]
    end
    array.push(my_hash)
  }
  return array
end

